import React from 'react';



const ClientProjectItem = ({id, name, number, start_date, end_date, assigned_to, type, payment_received, payment_date, client_id}) => {
  return (


     <div class="row">
        {/* <th scope="row">{id}</th> */}
        <div>{number}</div>
        <div>{name}</div>
        <div>{start_date}</div>
        <div>{end_date}</div>
        <div>{assigned_to}</div>
        <div>{type}</div>
        <div>{client_id}</div>
        <div>{payment_received}</div>
        <div>{payment_date}</div>

    </div>
  );

}


export default ClientProjectItem;
